This is a tag match on a temporary set. The US girls are ready and willing to fight on any mat any time, anywhere!!! Team Dragon just hasn't had any luck this season. They did fantastic in the super mega awesome battle dream supreme but they have only won one tag match and they have fallen desparately behind in total points for the season. Not only are they behind but they have had several of their members retire mid season. Audrey rose is out for the rest of the season and if Dragon wants to stay in this game they need to recruit a new girl and put her in at least one match. Today they recruit Daisy Ducati. She's new to US but has a lot of wrestling experience. She's beating several of our US vets in submission wrestling. And in this first round she holds her own against Bella Rossi and Izamar Gutierrez. The scoring system is the same however the app used for matching on &quot;tour&quot; only scores 1 point per click where the regular score board count 2 points per click. The scores for the total season will be what you see at the end of the match.

